// frontend/src/pages/AdminPage.js

import React, { useState, useEffect, useCallback } from 'react';
import apiClient from '../api/apiClient';
import UserEditModal from '../components/UserEditModal';

const AdminPage = () => {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [editingUser, setEditingUser] = useState(null);

  const fetchUsers = useCallback(async () => {
    try {
      setLoading(true);
      const { data } = await apiClient.get('/users/');
      setUsers(data);
      setError('');
    } catch (err) {
      setError('Failed to load users. You may not have permission to view this page.');
      console.error(err);
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchUsers();
  }, [fetchUsers]);

  const handleOpenModal = (user = null) => {
    setEditingUser(user);
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setEditingUser(null);
    setIsModalOpen(false);
  };

  const handleSaveUser = async (userData, userId) => {
    try {
      setError(''); // Clear previous errors
      if (userId) {
        // Editing existing user
        const { password, ...updateData } = userData;
        // Only include password in the payload if it's not empty
        const dataToSend = (password && password.length > 0) ? userData : updateData;
        await apiClient.put(`/users/${userId}`, dataToSend);
      } else {
        // Creating new user
        await apiClient.post('/users/', userData);
      }
      handleCloseModal();
      fetchUsers(); // Refresh the user list
    } catch (err) {
      setError(err.response?.data?.detail || 'Failed to save user. Please check the data and try again.');
      console.error(err);
    }
  };

  const handleDeleteUser = async (userId) => {
    // Using a simple browser confirm dialog for this action
    if (window.confirm('Are you sure you want to permanently delete this user?')) {
      try {
        setError(''); // Clear previous errors
        await apiClient.delete(`/users/${userId}`);
        fetchUsers(); // Refresh the user list
      } catch (err) {
        setError(err.response?.data?.detail || 'Failed to delete user.');
        console.error(err);
      }
    }
  };

  if (loading) return <div>Loading user data...</div>;

  return (
    <>
      {isModalOpen && (
        <UserEditModal 
          user={editingUser}
          onSave={handleSaveUser}
          onClose={handleCloseModal}
        />
      )}
      <div className="bg-white p-8 rounded-lg shadow-md">
        <div className="flex justify-between items-center mb-6">
          <h1 className="text-2xl font-bold text-gray-900">User Management</h1>
          <button onClick={() => handleOpenModal()} className="px-4 py-2 bg-indigo-600 text-white font-medium rounded-md hover:bg-indigo-700">
            + Create User
          </button>
        </div>
        
        {error && <p className="text-red-500 mb-4">{error}</p>}
        
        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Name</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Email</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Role</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Status</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Actions</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {users.map(user => (
                <tr key={user.id}>
                  <td className="px-6 py-4 whitespace-nowrap">{user.first_name} {user.last_name}</td>
                  <td className="px-6 py-4 whitespace-nowrap">{user.email}</td>
                  <td className="px-6 py-4 whitespace-nowrap capitalize">{user.role}</td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${user.is_active ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'}`}>
                      {user.is_active ? 'Active' : 'Inactive'}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm font-medium space-x-4">
                    <button onClick={() => handleOpenModal(user)} className="text-indigo-600 hover:text-indigo-900">Edit</button>
                    <button onClick={() => handleDeleteUser(user.id)} className="text-red-600 hover:text-red-900">Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
};

export default AdminPage;
